// Navigation.js
import React from 'react';
import './Navigation.css';
import { Link, useNavigate } from 'react-router-dom';

function Navigation ({ onSurveyButtonClick }) {
    const navigate = useNavigate();


//   const scrollToSection = (sectionId) => {
//     const section = document.getElementById(sectionId);
//     if (section) {
//       section.scrollIntoView({ behavior: 'smooth' });
//     }
//   };

const handleHomeButtonClick = () => {
    navigate('/');
};

const handleSurveyButtonClick = () => {
    navigate('/club_matching_survey');
};

const handleDashboardButtonClick = () => {
    navigate('/account_dashboard');
};

const handleUserRegistrationButtonClick = () => {
    navigate('/user_registration');
};

const handleClubRegistrationButtonClick = () => {
    navigate('/club_registration');
};

  return (
    <nav className="navbar">
      <span className="navbar-title" >SJSU Club Matching</span>
      <ul>
        {/* <li><button onClick={handleHomeButtonClick}>Home</button></li>
        <li><button onClick={handleDashboardButtonClick}>Account Dashboard</button></li>
        <li><button onClick={handleClubRegistrationButtonClick}>Club Registration</button></li>
        <li><button onClick={handleUserRegistrationButtonClick}>User Registration</button></li>
        <li><button onClick={handleSurveyButtonClick}>Club Matching Survey</button></li> */}

<Router>
    <div className="App">
      <Navigation />
      <Routes>
          <Route path="/account_dashboard" element={<Dashboard />} />
          <Route path="/club_registration" element={<ClubRegistration />} />
          <Route path="/user_registration" element={<UserRegistration />} />
          <Route path="/club_matching_survey" element={<Survey />} />
        </Routes>
    </div>
    </Router>
      </ul>
    </nav>
  );
};

export default Navigation;
